    "union-slough-national-wildlife-refuge-narrative-report-may-1-1959-to-august-31-1959",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Union Slough
    NWR outlines Refuge accomplishments from May through August of 1959. The report
    begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    reptiles, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, vegetation control, and wildfires. Resource
    management is outlined; topics include grazing. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, and violations.
    Items of interest, N-R forms, and photographs are attached.",nt"license_title":
